<p style="text-align:center;"><strong><span style="font-family:Calibri;font-weight:bold;font-size:15px;">CONTRATTO PER COMPENSI AI SENSI DELLA LEGGE 133/99 E SUCCESSIVE MODIFICAZIONI</span></strong></p>
 <br>
<p style="text-align:center;"><strong><span style="font-family:Calibri;font-weight:bold;font-size:15px;">SCRITTURA PRIVATA</span></strong></p>
<p style="text-align:justify;"><span style="font-family:Calibri;font-size:15px;">Con il presente atto da tenere e valere in ogni migliore modo di ragione e legge tra:&nbsp;</span></p>
<p><span style="font-family:Calibri;font-size:15px;">&nbsp;</span></p>
<p style="text-align:justify;"><span style="font-family:Calibri;font-size:15px;">a) L&apos;Associazione Sportiva Dilettantistica&nbsp;</span><strong><span style="font-family:Calibri;font-weight:bold;font-size:15px;">ASD BAILA DANCE</span></strong><span style="font-family:Calibri;font-size:15px;">, aderente a A.S.C. cod. fiscale&nbsp;</span><strong><span style="font-family:Calibri;font-weight:bold;font-size:15px;">95234400638&nbsp;</span></strong><span style="font-family:Calibri;font-size:15px;">con sede sociale in Via Gramsci 33, 80020 Crispano (NA) qui rappresentata dal suo Presidente nella persona del Sig. Marco Miele nato a Maddaloni il 11/02/1989, C.F. MLIMRC89B11E791Z, residente a Via Renato Carosone 6, 81030 Orta di Atella, ed il&nbsp;</span></p>
<p><span style="font-family:Calibri;font-size:15px;">b) Sig <b><?php echo $nome." ".$cognome;?></b> nato a <b><?php echo $comune_nascita;?></b> il <b><?php echo date("d/m/Y", strtotime($datanascita));?></b> C.F <b><?php echo $codfiscale;?></b> </span>
<br />
&nbsp;&nbsp;&nbsp;&nbsp;Residente a <b><?php echo $comune_residenza;?></b> - Prov. (<b><?php echo $prov_residenza;?></b>) in <b><?php echo $indirizzo;?></b> Cap <b><?php echo $cap_residenza;?></b></span></p>
 <br />
<p style="text-align:center;"><strong><span style="font-family:Calibri;font-weight:bold;font-size:15px;">PREMESSO</span></strong></p>
 
<p style="text-align:left;"><span style="font-family:Calibri;font-size:15px;">*che il Sig <b><?php echo $nome." ".$cognome;?></b> ha manifestato la volont&agrave; di collaborare con l'Associazione senza vincoli di dipendenza nello svolgimento di attivit&agrave; istituzionale con mansioni di <b><?php echo $mansione;?></b></span></p>
<p style="text-align:justify;"><span style="font-family:Calibri;font-size:15px;">*che l&apos;Associazione Sportiva ha necessit&agrave; di assicurarsi un&rsquo;assistenza continuativa non in forma subordinata e di natura non professionale; nella forma della collaborazione coordinata e continuativa ai sensi di quanto previsto dall&rsquo;articolo 67 comma 1 lettera m) del decreto del presidente della repubblica 917/1986 al fine di ottimizzare i risultati dell&rsquo;organizzazione sportiva dell&rsquo;associazione;&nbsp;</span></p>
<p style="text-align:justify;"><span style="font-family:Calibri;font-size:15px;">*che le parti convengono che l&rsquo;attivit&agrave; del presente contratto &egrave; da considerarsi svolta nell&rsquo;esercizio diretto di attivit&agrave; sportiva dilettantistica;&nbsp;</span></p>
<p style="text-align:justify;"><span style="font-family:Calibri;font-size:15px;">Tutto ci&ograve; premesso quale parte integrante del presente accordo, fra le parti&nbsp;</span></p>
 <br>
<p style="text-align:center;"><strong><span style="font-family:Calibri;font-weight:bold;font-size:15px;">SI CONVIENE QUANTO SEGUE</span></strong></p>
<p style="text-align:justify;"><span style="font-family:Calibri;font-size:15px;">Il Sig <b><?php echo $nome." ".$cognome;?></b> effettuer&agrave; per il periodo dal <b><?php echo date("d/m/Y", strtotime($data_da));?></b> al <b><?php echo date("d/m/Y", strtotime($data_a));?></b> l&rsquo;attivit&agrave; di collaboratore presso &ldquo;</span><strong><span style="font-family:Calibri;font-weight:bold;font-size:15px;">Baila Dance</span></strong><span style="font-family:Calibri;font-size:15px;">&rdquo;. secondo modalit&agrave; di tempo ed orario da concordarsi in funzione delle esigenze dei propri soci/atleti e delle disponibilit&agrave; degli impianti.&nbsp;</span></p>
<p style="text-align:justify;"><span style="font-family:Calibri;font-size:15px;">&nbsp;</span></p>
<p style="text-align:justify;"><span style="font-family:Calibri;font-size:15px;">L&apos;Associazione &ldquo;</span><strong><span style="font-family:Calibri;font-weight:bold;font-size:15px;">Baila Dance</span></strong><span style="font-family:Calibri;font-size:15px;">&quot; corrisponder&agrave; per tale collaborazione al Sig.<b><?php echo $nome." ".$cognome;?></b></span></p>
<p style="text-align:justify;"><span style="font-family:Calibri;font-size:15px;">Euro <b><?php echo $importo_mensile;?></b>, Tale compenso verr&agrave; elargito entro il giorno 5 del mese successivo.&nbsp;</span></p>
<p style="text-align:justify;"><span style="font-family:Calibri;font-size:15px;">&nbsp;</span></p>
<p style="text-align:justify;"><span style="font-family:Calibri;font-size:15px;">E&rsquo; implicito che tale collaborazione esclude qualsiasi vincolo di subordinazione essendo quella prevista dal comma 4&deg; dell&rsquo;art. 25 della Legge 13 maggio 1999 n. 133 e successive modificazioni, con particolare riferimento all&rsquo;art. 90 della L. 27/12/2002 n&deg; 289.&nbsp;</span></p>
<p style="text-align:justify;"><span style="font-family:Calibri;font-size:15px;">&nbsp;</span></p>
<p style="text-align:justify;"><span style="font-family:Calibri;font-size:15px;">Sui corrispettivi che verranno erogati, sar&agrave; effettuata dalla Societ&agrave; una ritenuta a titolo d&rsquo;imposta per la parte eccedente la somma di &euro; 10.000,00 e fino a &euro; 28.158,28 ed a titolo di acconto per la parte eccedente tale cifra nella misura fissata per il primo scaglione dei redditi dall&rsquo;art. 11 del T.U.I.R. attualmente pari al 23% pi&ugrave; l&rsquo;addizionale regionale attualmente pari allo 0,9%.&nbsp;</span></p>
<p style="text-align:justify;"><span style="font-family:Calibri;font-size:15px;">&nbsp;</span></p>
<p style="text-align:justify;"><span style="font-family:Calibri;font-size:15px;">Il Sig <b><?php echo $nome." ".$cognome;?></b> si impegna a comunicare alla Associazione &quot;</span><strong><span style="font-family:Calibri;font-weight:bold;font-size:15px;">Baila Dance</span></strong><span style="font-family:Calibri;font-size:15px;">&quot; eventuali altri compensi, premi, rimborsi forfetari ecc. ricevuti anche da altre fonti tali da concorrere al superamento di &euro;10.000,00 o di &euro; 28.158,28 annui complessivamente. Resta comunque inteso che in relazione alla natura della presente scrittura l&apos;Associazione pu&ograve; in qualsiasi momento revocare al Sig. <b><?php echo $nome." ".$cognome;?></b> l&rsquo;incarico di collaborazione, corrispondendogli il compenso dovuto per l&rsquo;opera svolta fino al momento della revoca stessa ai sensi dell&rsquo;art. 2227 del Codice civile.&nbsp;</span></p>
