<p style="text-align:justify;"><strong><span style="font-family:Calibri;font-weight:bold;font-size:15px;">Consenso al trattamento dei dati personali&nbsp;</span></strong></p>
<p style="text-indent:35,4000pt;text-align:justify;"><em><span style="font-family:Calibri;font-style:italic;font-size:13px;">(in materia di privacy ai sensi del GDPR &ndash; Regolamento UE n. 679/2016)&nbsp;</span></em></p>
<p style="text-align:justify;"><span style="font-family:Calibri;font-size:13px;">Con la presente La informiamo che l&rsquo;</span><strong><span style="font-family:Calibri;font-weight:bold;font-size:13px;">ASD Baila Dance</span></strong><span style="font-family:Calibri;font-size:13px;">, da ora semplicemente&nbsp;</span><strong><span style="font-family:Calibri;font-weight:bold;font-size:13px;">ASD</span></strong><span style="font-family:Calibri;font-size:13px;">, con sede in, Crispano (NA) in via Gramsci 33, codice fiscale&nbsp;</span><strong><span style="font-family:Calibri;font-weight:bold;font-size:13px;">95234400638</span></strong><span style="font-family:Calibri;font-size:13px;">, mail info@bailadancenapoli.it, in qualit&agrave; di Titolare e Responsabile, tratter&agrave; i Suoi dati personali, identificativi ed anagrafici ai sensi dell&rsquo;articolo 13 del GDPR, con le modalit&agrave; e le precauzioni appresso indicate:&nbsp;</span></p>
<p style="text-align:justify;"><span style="font-family:Calibri;font-size:13px;">&nbsp;</span></p>
<p style="text-align:justify;"><strong><span style="font-family:Calibri;font-weight:bold;font-size:13px;">1) Figure che intervengono nel trattamento.&nbsp;</span></strong></p>
<p style="text-align:justify;"><em><span style="font-family:Calibri;font-style:italic;font-size:13px;">Interessato&nbsp;</span></em><strong><span style="font-family:Calibri;font-weight:bold;font-size:13px;">&ndash;&nbsp;</span></strong><span style="font-family:Calibri;font-size:13px;">Colui che conferisce i propri dati personali ed al quale la presente informativa &egrave; rivolta;&nbsp;</span></p>
<p style="text-align:justify;"><em><span style="font-family:Calibri;font-style:italic;font-size:13px;">Titolare del trattamento&nbsp;</span></em><span style="font-family:Calibri;font-size:13px;">&ndash;&nbsp;</span><strong><span style="font-family:Calibri;font-weight:bold;font-size:13px;">Marco Miele&nbsp;</span></strong><span style="font-family:Calibri;font-size:13px;">che raccoglie il dato e lo elabora, archivia o trasmette;&nbsp;</span></p>
<p style="text-align:justify;"><em><span style="font-family:Calibri;font-style:italic;font-size:13px;">Responsabile del trattamento&nbsp;</span></em><span style="font-family:Calibri;font-size:13px;">&ndash;&nbsp;</span><strong><span style="font-family:Calibri;font-weight:bold;font-size:13px;">Marco Miele&nbsp;</span></strong></p>
<p style="text-align:justify;"><em><span style="font-family:Calibri;font-style:italic;font-size:13px;">Terzo che riceve il dato&nbsp;</span></em><span style="font-family:Calibri;font-size:13px;">&ndash; Colui al quale il dato &egrave; conferito dalla&nbsp;</span><strong><span style="font-family:Calibri;font-weight:bold;font-size:13px;">Baila Dance</span></strong><span style="font-family:Calibri;font-size:13px;">.&nbsp;</span></p>
<p style="text-align:justify;"><span style="font-family:Calibri;font-size:13px;">&nbsp;</span></p>
<p style="text-align:justify;"><strong><span style="font-family:Calibri;font-weight:bold;font-size:13px;">2) Modalit&agrave; di trattamento&nbsp;</span></strong></p>
<p style="text-align:justify;"><span style="font-family:Calibri;font-size:13px;">La raccolta ed il trattamento dei Suoi dati personali avranno luogo, dopo il Suo consenso. Il trattamento potr&agrave; avvenire anche con l&rsquo;ausilio di mezzi cartacei, elettronici, informatici o via web per le operazioni indicate dall&rsquo;art. 4 del Codice e dall&rsquo;art. 4 n. 2 del GDPR quali: registrazione, organizzazione, consultazione, elaborazione, modificazione, estrazione, utilizzo, comunicazione, cancellazione.&nbsp;</span></p>
<p style="text-align:justify;"><span style="font-family:Calibri;font-size:13px;">&nbsp;</span></p>
<p style="text-align:justify;"><strong><span style="font-family:Calibri;font-weight:bold;font-size:13px;">3) Finalit&agrave; del trattamento.&nbsp;</span></strong></p>
<p style="text-align:justify;"><span style="font-family:Calibri;font-size:13px;">Il trattamento, a seguito del Suo consenso, &egrave; finalizzato alla gestione della Sua richiesta di&nbsp;</span><em><span style="font-family:Calibri;font-style:italic;font-size:13px;">collaboratore sportivo dell&rsquo;ASD&nbsp;</span></em><span style="font-family:Calibri;font-size:13px;">cos&igrave; come previsto dallo Statuto dell&rsquo;Ente, alla partecipazione alle attivit&agrave; proposte, ed al Suo tesseramento a Enti di Promozione Sportiva o Federazioni del CONI nonch&eacute; all&rsquo;inserimento nel Registro C.O.N.I. per il riconoscimento ai fini sportivi dilettantistici. All&rsquo;indirizzo mail, che indicher&agrave; in sede di richiesta di adesione, saranno inviate comunicazioni relative alla gestione del tesseramento stesso, ivi comprese le comunicazioni per le attivit&agrave; svolte con la ASD.&nbsp;</span></p>
<p style="text-align:justify;"><span style="font-family:Calibri;font-size:13px;">&nbsp;</span></p>
<p style="text-align:justify;"><strong><span style="font-family:Calibri;font-weight:bold;font-size:13px;">4) Obbligatoriet&agrave; del conferimento&nbsp;</span></strong></p>
<p style="text-align:justify;"><span style="font-family:Calibri;font-size:13px;">Il conferimento &egrave; necessario ed obbligatorio per le citate finalit&agrave; ed il diniego comporter&agrave; l&rsquo;impossibilit&agrave; di aderire alla ASD, al tesseramento ed all&rsquo;invio dei dati al Registro CONI.&nbsp;</span></p>
<p style="text-align:justify;"><span style="font-family:Calibri;font-size:13px;">&nbsp;</span></p>
<p style="text-align:justify;"><strong><span style="font-family:Calibri;font-weight:bold;font-size:13px;">5) Comunicazione dei dati&nbsp;</span></strong></p>
<p><span style="font-family:Calibri;font-size:13px;">I dati da Lei forniti verranno da noi trattati e comunicati, per le finalit&agrave; indicate del trattamento, al nostro ente di affiliazione &ndash; Ente di Promozione Sportiva riconosciuto dal CONI, e tramite questo a CONI Servizi S.p.A. e Coninet S.p.A., per le finalit&agrave; istituzionali conseguenti il tesseramento. Gli stessi agiranno in piena autonomia in qualit&agrave; di Responsabili del trattamento per i rispettivi adempimenti di competenza. Inoltre, i dati stessi a richiesta, saranno comunicati a Pubbliche Amministrazioni per fini di legge.&nbsp;</span></p>
<p><span style="font-family:Calibri;font-size:13px;">&nbsp;</span></p>
<p style="text-align:justify;"><strong><span style="font-family:Calibri;font-weight:bold;font-size:13px;">6) Luogo e modalit&agrave; di conservazione dei dati&nbsp;</span></strong></p>
<p style="text-align:justify;"><span style="font-family:Calibri;font-size:13px;">I dati personali sono conservati, dal Titolare del trattamento, su supporto cartaceo e/o su server informatici, in luoghi di norma ubicati all&rsquo;interno della Comunit&agrave; Europea. A richiesta dell&rsquo;interessato, in riferimento a quella data, verranno comunicati gli indirizzi di conservazione.&nbsp;</span></p>
<p style="text-align:justify;"><span style="font-family:Calibri;font-size:13px;">&nbsp;</span></p>
<p style="text-align:justify;"><span style="font-family:Calibri;font-size:13px;">&nbsp;</span></p>
<p style="text-align:justify;"><strong><span style="font-family:Calibri;font-weight:bold;font-size:13px;">7) Periodo di conservazione dei dati&nbsp;</span></strong></p>
<p style="text-align:justify;"><span style="font-family:Calibri;font-size:13px;">I Suoi dati saranno conservati per il periodo previsto dalla normativa vigente CONI. Decorso tale termine, gli stessi saranno archiviati in file protetti per il periodo previsto dalle normative di legge, ed al termine distrutti.&nbsp;</span></p>
<p style="text-align:justify;"><span style="font-family:Calibri;font-size:13px;">&nbsp;</span></p>
<p style="text-align:justify;"><strong><span style="font-family:Calibri;font-weight:bold;font-size:13px;">8) Diritti dell&rsquo;interessato&nbsp;</span></strong></p>
<p style="text-align:justify;"><span style="font-family:Calibri;font-size:13px;">Con specifica istanza, da inviare alla ASD, Titolare del trattamento, tramite raccomandata o posta elettronica, potr&agrave; conoscere i Suoi dati personali in possesso dell&rsquo;Ente, chiederne la modifica, la rettifica o la distruzione. Inoltre potr&agrave; completarli, aggiornarli o richiederne copia. Eventuali richieste di copie su supporto cartaceo non ritirate presso la sede dell&rsquo;Ente saranno soggette a contributo spese di invio. Potr&agrave; inoltre, con le stesse modalit&agrave;, revocare il consenso, opporsi al trattamento di tutti o parte dei dati, o chiederne l&rsquo;invio a terzi da Lei indicati. Potr&agrave; proporre reclami al Garante per la protezione dei dati personali qualora ritenesse violati i Suoi diritti.&nbsp;</span></p>
<p style="text-align:justify;"><span style="font-family:Calibri;font-size:13px;">&nbsp;</span></p>
<p style="text-align:justify;"><strong><span style="font-family:Calibri;font-weight:bold;font-size:13px;">9) Modalit&agrave; di controllo&nbsp;</span></strong></p>
<p style="text-align:justify;"><span style="font-family:Calibri;font-size:13px;">Verranno posti in essere controlli di sicurezza funzionali in ambito informatico e web mediante:&nbsp;</span></p>
<p style="text-align:justify;"><span style="font-family:Calibri;font-size:13px;">- Controllo e tracciabilit&agrave; degli accessi mediante ID e Password di livelli diversi; - Conservazione di supporti cartacei in luoghi protetti ed accessibili solo a personale incaricato;&nbsp;</span></p>
<p style="text-align:justify;"><span style="font-family:Calibri;font-size:13px;">- Conservazione dei supporti fisici del server in luogo protetto e Backup dei dati;&nbsp;</span></p>
<p style="text-align:justify;"><span style="font-family:Calibri;font-size:13px;">- Stipula di contratti accurati in tema di trattamento dei dati personali.&nbsp;</span></p>
<p style="text-align:justify;"><span style="font-family:Calibri;font-size:13px;">- Codifica del Trattamento con individuazione e partizione dei processi;&nbsp;</span></p>
<p style="text-align:justify;"><span style="font-family:Calibri;font-size:13px;">- Sistema di protezione da Malware;&nbsp;</span></p>
<p style="text-align:justify;"><span style="font-family:Calibri;font-size:13px;">- Minimizzazione dei dati trattati.&nbsp;</span></p>
